import React from "react";
import styled from "styled-components";

const DropdownSelect = styled.select`
height:35px;
padding:0 10px;
font-weight:bold;
`;

const Dropdown = () => {
  return (
    <>
      <DropdownSelect>
        <option>&#128197; Week</option>
        <option disabled>&#128197; Month</option>
      </DropdownSelect>
    </>
  );
};

export default Dropdown;
